import React, { Component } from "react";

class Item extends Component {
  render() {
    const { idx, item } = this.props;
    // console.log(item); //40ss

    // 5ms47ss
    let levelEle = null;
    let label
    if (item.level === 0) {
      levelEle = "Beginer";
    } else if (item.level === 1) {
      levelEle = "Small";
    } else if (item.level === 2) {
      levelEle = "Medium";
    } else if (item.level === 3) {
      levelEle = "High";
    }

    return (
      // 3ms01ss
      <tr>
        <td className="text-center">{idx}</td>
        <td>{item.name}</td>
        <td className="text-center">
          <span className="label label-danger">{levelEle}</span>
        </td>
        <td>
          <button type="button" className="btn btn-warning">
            Edit
          </button>
          <button type="button" className="btn btn-danger">
            Delete
          </button>
        </td>
      </tr>
    );
  }
}

export default Item;
